import React from "react";
import '../css/header.css';

const header = () =>{

    return(
        <header>
            <h1>
                <a href="#">WEB TEST03</a>
            </h1>
            <nav>
                <ul>
                    <li><a href="#">HOME</a></li>
                    <li><a href="#">ISBNコード</a></li>
                    <li><a href="#">タイトル</a></li>
                    <li><a href="#">著者</a></li>
                </ul>
            </nav>
        </header>
    );

}
export default header;
